import React from 'react';

function FacilitiesList() {
  const facilities = [
    "Facility 1",
    "Facility 2",
    "Facility 3",
    "Facility 4",
    "Facility 5"
  ];

  const facilityLogo = "https://cdn.builder.io/api/v1/image/assets/TEMP/64f86958cbb3ab0d42bdcfc7e147c123b5342f5eae207c89f0bbb848ea0d1c67?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82"; // Facility logo URL

  return (
    <section className="flex flex-col mt-0 bg-white border rounded-lg p-4 w-[500px]">
      <h3 className="sr-only">Facilities List</h3>
      {/* Header with logo */}
      <div className="flex items-center mb-4">
        <img
          loading="lazy"
          src={facilityLogo}
          alt="Facility Logo"
          className="w-14 h-14 rounded-full mr-4"
        />
        <h3 className="text-lg font-medium text-gray-900">Facilities</h3>
      </div>

      {/* Facilities list */}
      <ul className="flex flex-col w-full border-t">
        {facilities.map((facility, index) => (
          <li key={index} className="flex items-center gap-4 py-3 w-full border-b">
            {/* Replacing gray circle with an image */}
            <img
              src={facilityLogo} // Same logo for all facilities, replace with individual images if available
              alt={facility}
              className="w-10 h-10 rounded-full"
            />
            <div className="flex-auto text-gray-700">{facility}</div>
          </li>
        ))}
      </ul>
    </section>
  );
}

export default FacilitiesList;
